import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import ChemistUpload from "./pages/ChemistUpload";
import DoctorCreatePrescription from "./pages/DoctorCreatePrescription";
import ChemistScan from "./pages/ChemistScan";

function App(){
  return (
    <div className="container">
      <header>
        <div>
          <h1>LifeTag</h1>
          <div style={{color:"#666"}}>Pharmacy & Prescription Manager</div>
        </div>
        <nav>
          <Link style={{marginRight:12}} to="/">Upload Bills</Link>
          <Link style={{marginRight:12}} to="/create-prescription">Create Prescription</Link>
          <Link to="/scan">Scan QR</Link>
        </nav>
      </header>

      <Routes>
        <Route path="/" element={<ChemistUpload />} />
        <Route path="/create-prescription" element={<DoctorCreatePrescription />} />
        <Route path="/scan" element={<ChemistScan />} />
      </Routes>
    </div>
  );
}

export default App;
